DROP TABLE IF EXISTS KFF2019_new;

CREATE TABLE KFF2019_new(
    Location         VARCHAR(20) NOT NULL PRIMARY KEY,
    All_Uninsured    NUMERIC(5,3),
    Female_Uninsured NUMERIC(5,3),
    Male_Uninsured   NUMERIC(5,3)
);
        

DROP TABLE IF EXISTS USCDI;

CREATE TABLE USCDI(
    YearStart               INTEGER NOT NULL,
    YearEnd                 INTEGER NOT NULL,
    LocationDesc            VARCHAR(20) NOT NULL,
    Topic                   VARCHAR(22) NOT NULL,
    Question                VARCHAR(81) NOT NULL,
    DataValueUnit           VARCHAR(17) NOT NULL,
    DataValueType           VARCHAR(17) NOT NULL,
    DataValue               NUMERIC(6,1),
    StratificationCategory1 VARCHAR(7) NOT NULL,
    Stratification1         VARCHAR(9) NOT NULL,
    Has2019                 VARCHAR(5),
    Range                   INTEGER,
    AvgDataValue            VARCHAR(19),
    PRIMARY KEY(YearStart, YearEnd, LocationDesc, Topic, Question, DataValueUnit, DataValueType, StratificationCategory1, Stratification1)
);
        

DROP TABLE IF EXISTS USCDI_CHD;

CREATE TABLE USCDI_CHD(
    LocationDesc    VARCHAR(20) NOT NULL PRIMARY KEY,
    Frac_F          VARCHAR(19),
    CHD_Deaths      VARCHAR(18),
    CHD_Deaths_F    VARCHAR(18),
    CHD_Deaths_M    VARCHAR(18),
    CHDPercentage   VARCHAR(22),
    CHDPercentage_F VARCHAR(22),
    CHDPercentage_M VARCHAR(22)
);
        

